import React,{ Component } from "react";
import Highcharts from 'highcharts'
import HighchartsReact from 'highcharts-react-official'
export default function WorldMap(props) {

    const chart = {
        title:{
            text :'My-Chart'
        },
        series:[{
            data: [
                ["ALG",6],
                ["ARGN",25],
                ["ASRA",3],
                ["AUS",27],
                ["AZER",3],
                ["BEL",4],
                ["US", 13517]
               ]
        }]

    };

          return <div>
              <h2>Highmaps</h2>
              <HighchartsReact 
              highcharts = {Highcharts}
              options = {chart}
              />
          </div>

}
